import { React } from "react";
import {
  Home,
  Favorite,
  Whatshot,
  TrendingUp,
  FiberNew,
  Update,
} from "@material-ui/icons";
import "./styles.css";

const DrawerExpanded = (props) => {
  const {
    handleHomeClick,
    handlePopularClick,
    handleTrendingClick,
    handleLatestClick,
    handleUpcomingClick,
    handleFavouritesClick,
  } = props;

  return (
    <div
      class="drawer-container"
      style={{ width: 400, transition: "0.5s ease-in-out" }}
    >
      <div class="expanded-drawer-menu-item">
        <Home class="expanded-drawer-menu-icon" onClick={handleHomeClick} />
      </div>
      <div class="expanded-drawer-menu-item">
        <Whatshot
          class="expanded-drawer-menu-icon"
          onClick={handlePopularClick}
        />
      </div>
      <div class="expanded-drawer-menu-item">
        <TrendingUp
          class="expanded-drawer-menu-icon"
          onClick={handleTrendingClick}
        />
      </div>
      <div class="expanded-drawer-menu-item">
        <FiberNew
          class="expanded-drawer-menu-icon"
          onClick={handleLatestClick}
        />
      </div>
      <div class="expanded-drawer-menu-item">
        <Update
          class="expanded-drawer-menu-icon"
          onClick={handleUpcomingClick}
        />
      </div>
      <div class="expanded-drawer-menu-item">
        <Favorite
          class="expanded-drawer-menu-icon"
          onClick={handleFavouritesClick}
        />
      </div>
    </div>
  );
};

export default DrawerExpanded;
